package com.synext.config.nim;

import com.alibaba.fastjson.JSON;
import co.synext.config.nim.entity.req.MsgUploadRequestEntity;
import co.synext.config.nim.entity.req.message.VoiceMsg;
import co.synext.config.nim.service.INimMsgService;

import co.synext.GovernApplication;

import org.junit.Test;
import org.junit.runner.RunWith;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.test.context.junit4.SpringRunner;

/**
 * <p>
 * 网易云信 消息接口测试
 * </p>
 *
 * @author xu.ran
 * @since 2020-04-10
 */

@RunWith(SpringRunner.class)
@SpringBootTest(classes = GovernApplication.class, webEnvironment = SpringBootTest.WebEnvironment.RANDOM_PORT)
public class NimMsgServiceTest {

    @Autowired
    private INimMsgService nimMsgService;

    @Test
    public void voiceMsgTest(){
        System.out.println(VoiceMsg.builder()
                .size(11000l)
                .dur(1)
                .md5("4564")
                .url("hdsajkdhsjkahdjk ")
                .build().toJSONString()
        );
    }

    @Test
    public void uploadTest(){
        System.out.println(JSON.toJSONString(nimMsgService.upload(MsgUploadRequestEntity.builder()
                .expireSec(86400)
                .type("gif")
                .content("base64,")
                .build())));
    }

}
